import {put} from "redux-saga/effects";
import * as API from "../api/index";
import {callBackGoogle2} from "../slices/userSlices";

export function* callBackGoogleSaga(action){
try {
  const {data:{url}} = yield API.fetchCreateUser(action.payload);
  yield put(callBackGoogle2(url));
} catch (error) {
  
}
};
